import React from 'react';
import portfolioProject from '../text/portfolio-project.js'
import NotFoundPage from './NotFoundPage';
import githubIcon from '../images/githubIcon.png';
import tarIcon from '../images/tarIcon.png';


const ProjectPage = ({ match }) => {
    const name = match.params.name;
    const project = portfolioProject.find(project => project.name === name);

    // If the project is not found under the /portfooio endpoint
    if (!project) return <NotFoundPage />
    return (
        <>
            <h1>{project.title}</h1>

            <p class="projectText">
                <h3>Project Info</h3>
                Author(s): {project.author} 
                <br/>Date: {project.date}
                <br/>Description: {project.description}
                <br/><br/><button>Download .tar file<img class="buttonIcon" src={tarIcon} alt=" "/></button>
                <br/><br/><button class="githubButton">View on GitHub<img class="buttonIcon" src={githubIcon} alt=" "/></button>

                <iframe width="560" height="315" src={project.vidLink} frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            </p>
        </>
    )
};

export default ProjectPage;
